import './App.css';
import milk from './assets/milk.jpg'

function App() {
  return (
    <div className="App bg-blue-200 h-screen flex items-center justify-center">
      <header className="App-header">
        <h1>My website</h1>
        <div>
       <img src={milk} alt="milkchocobar"/>
        </div>
      </header>
    </div>
  );
}

export default App;
